contracts/hello.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract hello{
    uint private age;
    string private name;

    constructor(uint _age, string memory _name ){
        age = _age;
        name = _name;
    }

    function getName() public  view returns (string memory){
        return name;
    }

    function transfer(address payable to, uint256 count) public returns (bool res){
        to.transfer(count);
        return true;
    } 
}

